import './App.css';
import {useState} from "react";
import {Button, Container, Jumbotron, Navbar, Toast} from "react-bootstrap";

function App() {
    return (
        <>
            <Navbar bg="dark" variant="dark">
                <Navbar.Brand href="#home">
                    <img
                        alt=""
                        src="/logo192.png"
                        width="30"
                        height="30"
                        className="d-inline-block align-top"
                    />{' '}
                    React Bootstrap
                </Navbar.Brand>
            </Navbar>
            <Container className="p-3">
                <Jumbotron>
                    <h1 className="header">Welcome To React-Bootstrap</h1>
                </Jumbotron>
            </Container>
        </>
    );
}

export default App;
